attempts.cypher:
MATCH (i:Ingress)-[:DefinesBackend]->(isb:IngressServiceBackend)-[:TargetsService]->(svc:Service)
WHERE i['metadata']['namespace'] = 'litmus'
AND EXISTS {
  MATCH (svc)-[:Manages]->(es:EndpointSlice)-[:ContainsEndpoint]->(:Endpoint)
}
RETURN i['metadata']['name'] AS ingress_name, svc['metadata']['name'] AS service_name

